import Contacto from '../Body/Contacto'

let dirContacto = Contacto;

const Navigation = () => {
    return (
      <nav className={styles.nav}>
        <ul>

            <li>
              <a href="/">videos</a>
            </li>


            <li>
              <a href={dirContacto}>photos</a>
            </li>

        </ul>
      </nav>
    );
  };

  export default Navigation;
